  public async getExternalJson(url: string): Promise<any> {
    let rest = await fetch(url);
    return await rest.json();
  }

  public async getDescription(url: string, lang: string): Promise<string> {
    let description = '';
    const rest = await fetch(url);
    const data = await rest.json();

    try {
      description = await data.flavor_text_entries.filter((entry: any) => entry.language.name === lang)[0].flavor_text.replace(/\n/g, ' ');
    } catch (error) {
      try {
        description = await data.flavor_text_entries[0].flavor_text.replace(/\n/g, ' ');
      } catch (error) {
        description = '';
      }
    }

    return description;
  }

  public async getSpecie(url: string, lang: string): Promise<string> {
    let species: string = '';
    const rest = await fetch(url);
    const data = await rest.json();

    try {
      species = await data.genera.filter((entry: any) => entry.language.name === lang)[0].genus.replace(/\n/g, ' ');
    } catch (error) {
      try {
        species = await data.genera[0].genus.replace(/\n/g, ' ');
      } catch (error) {
        species = '';
      }
    }

    return await data.genera.filter((entry: any) => entry.language.name === lang)[0].genus.replace(/\n/g, ' ');
  }

