  private setStatsPokemon(stats: any[], poke: PokemonInterface) {
    let aux_poke: PokemonInterface = poke;

    stats.forEach((element: any) => {
      switch (element.stat.name) {
        case 'hp':
          aux_poke.hp = element.base_stat;
          aux_poke.hp_max = element.base_stat;
        break;
        case 'attack':
          aux_poke.attack = element.base_stat;
        break;
        case 'defense':
          aux_poke.defense = element.base_stat;
        break;
        case 'special-attack':
          aux_poke.special_attack = element.base_stat;
        break;
        case 'special-defense':
          aux_poke.special_defense = element.base_stat;
        break;
        case 'speed':
          aux_poke.speed = element.base_stat;
        break;

        default:
          break;
      }
    });

    return aux_poke;
  }

  private setTypesPokemon(types: any[], poke: PokemonInterface) {
    let aux_poke: PokemonInterface = poke;

    try {
      aux_poke.tipo_uno = types[0].type.name;
    } catch (error) {
      aux_poke.tipo_uno = 'vacio';
    }

    try {
      aux_poke.tipo_dos = types[1].type.name;
    } catch (error) {
      aux_poke.tipo_dos = 'vacio';
    }

    return aux_poke;
  }

